import React, { Component } from "react";
import "./style.css";

class Footer extends Component {

  componentDidMount() {
    const M = window.M
    document.addEventListener('DOMContentLoaded', function() {
      var elems = document.querySelectorAll('.sidenav');
      M.Sidenav.init(elems, {});
    });
  }

  render() {
    return (
        <div>
            <footer class="page-footer" id="footer">
                <div class="links">
                    <a class="grey-text text-lighten-3" href="https://www.linkedin.com/in/alexander-vellios/" target=" ">View My
                        LinkedIn | </a>
                    <a class="grey-text text-lighten-3" href="https://github.com/TheGreekCuban" target=" ">View My GithHub</a>
                </div>
                <div class="container" id="copyright"> Â© 2019 Alexander Vellios </div>
            </footer>
        </div>

    )
  }
}

export default Footer;
